// 6-7: Bien
// 7-9: Notable
// 9-10: Sobresalienten
function notaAlumno(n){
    if(n>10 || n<0) return "Debe ingresar una nota entre 1 y 10"
    if(n>=0 && n<=3){
        return "Muy deficiente"
    }else if(n>=4 && n<=5){
        return "Insuficiente"
    }else if(n==6){
        return "Suficiente"
    }else if(n==7){
        return "Bien"
    }else if(n>=8 && n<=9){
        return "Notable"
    }else if(n==10){
        return "Sobresalienten"
    }
}
